'use client';
import { jsx } from 'react/jsx-runtime';
import { forwardRef } from 'react';

const DropdownItem = forwardRef(function DropdownItem({ className, ...rest }, ref) {
    return jsx("li", { ref: ref, ...rest });
});

export { DropdownItem };
